import Modal from 'react-modal'
import {useState} from 'react'

export default function Login({visible, setVisible}) {
    return(
        <div>
            <Modal 
                isOpen={visible}
                style={{
                    overlay: {
                      position: 'fixed',
                      top: 0,
                      left: 0,
                      right: 0,
                      bottom: 0,
                      backgroundColor: 'red'
                    },
                    content: {
                      position: 'absolute',
                      top: '40px',
                      left: '40px',
                      right: '40px',
                      bottom: '40px',
                      border: '1px solid #ccc',
                      background: '#fff',
                      overflow: 'auto',
                      WebkitOverflowScrolling: 'touch',
                      borderRadius: '4px',
                      outline: 'none',
                      padding: '20px'
                    }
                  }}    
            >
                <div onClick={() => setVisible(false)}>x</div>
                <h1>Model Body</h1>
            </Modal>
        </div>
    )
}
